import { Link , useLocation  } from 'react-router-dom'; 
import './find.css';
import React, {useEffect, useState } from "react";
import Axios from "axios";

function find ()
{


    const [data, setUserList] = useState([]);
   
    const location = useLocation();
      const getuser = async () =>
      {
        try{
            const response = await Axios.get("http://localhost:3002/details");
          
            setUserList(response.data.users);
            return response.data.users ;
        }catch(error)
        {
            console.error("fetching err" ,error);
        }
      };
    
      useEffect(() => {
        getuser();
      }, [location]);
      getuser();
      


   return( 

<div className='tablebox' >
      <table border="1" style={{ width: "100%", margin: "auto", textAlign: "left" }}>
        <thead>
          <tr>
     
            <th>disticts</th>
            <th>stream</th>
            <th>course</th>
            <th>Z-Range</th>
           
            <th>action</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.id}>
           
              <td>{row.district}</td>
              <td>{row.stream}</td>
              <td>{row.course}</td>
              <td>{row.zValue1} - {row.zValue2}</td>
            
            </tr>
          ))}
        </tbody>
      </table>
      </div>
    
);
}
export default find;
